import React from 'react'

class App extends React.Component {

    constructor(){
        super()
        this.state = {
            count: 0
        }
    }

    render(){

        return(
            <>
                <h1>Count</h1>
                <h3>{this.state.count}</h3>
                <button onClick={() => this.setState({count: this.state.count + 1})}>Add</button>
            </>
        )
    }
}

export default App
